function getTimeRemaining(e){var n=Date.parse(e)-Date.parse(new Date),r=Math.floor(n/1e3%60),t=Math.floor(n/1e3/60%60),a=Math.floor(n/36e5%24);return{total:n,days:Math.floor(n/864e5),hours:a,minutes:t,seconds:r}}function initializeClock(e,n){var r=document.getElementById(e),t=r.querySelector(".days"),a=r.querySelector(".hours"),o=r.querySelector(".minutes"),i=r.querySelector(".seconds");function l(){var e=getTimeRemaining(n);t.innerHTML=("0"+e.days).slice(-2),a.innerHTML=("0"+e.hours).slice(-2),o.innerHTML=("0"+e.minutes).slice(-2),i.innerHTML=("0"+e.seconds).slice(-2),e.total<=0&&clearInterval(s)}l();var s=setInterval(l,1e3)}var d=new Date,h=d.getHours(),num_hour=17-h,h_end=num_hour;num_hour<=0&&(h_end=24-Math.abs(num_hour));var deadline=new Date(Date.parse(new Date)+60*h_end*60*1e3);initializeClock("clockdiv",deadline);